import React from 'react';

function InfoTooltip() {
    return (
        <div className="popup popup-info">
            <button className="button-close popup__close popup__close_btn_close popup__button-close" type="button"></button>
            <img className="popup-info__img" src="" alt="" />
            <h2 className="popup-info__title"></h2>
        </div>
    )
}

export default InfoTooltip;
